a028da549b3c\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Problem\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem\"},\"subContentId\":\"c6275b39-246d-479e-b905-c3318bbb1267\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1) 48.2 × 4 = 192.8<br />\\n192.8 cm of wood will be used to frame the picture.</p>\\n\\n<p> </p>\\n\\n<p>2) 48.2 × 48.2 = 2,323.24<br />\\nThe area of the glass that will be used to cover the picture is 2,323.24 cm\\\\(^2\\\\).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"79594763-b44f-4b2b-bc9c-f11f0008bfc7\"},{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAC7gAAAOECAMAAAAGnIz6AAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAACHUExURf///+fn55eXl0BAQCAgIAAAABgYGGBgYK+vr4eHhwgICMfHx0hISBAQENfX1/f391hYWLe3t7+/vzg4OCgoKKenp5+fn3BwcDAwMGhoaM/Pz9/f31BQUH9/f4+Pj+/v73h4eOHh4ZqamvDw8LKysnx8fE1NTYyMjNDQ0NnZ2b29venp6QAAAIeHMpsAAAAtdFJOU///////////////////////////////////////////////////////////AKXvC/0AAAAJcEhZcwAADsMAAA7DAcdvqGQAAFmfSURBVHhe7d3Lcuo6twbQXQU0aFCVTqoINKBo8v4PuA1ItuVLEiSxQsIY69T5uQRDWGvbn6an5P8AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAD4pQ6n7XK1WXy8h/sAAMDzWa+i7S48BAAAPJfDIqT2i80+PAoAADyVTZPX387Njd32ktxvDwIAAM/lfbWJve2X2rs+dwAAeEqntj3m0AT3j3AbAAB4VpvVahtuAgAAz2oruAMAwPNbrVbHcBMAAHhS7yanAgDA09s1uV2nDAAAPLXdW5Pbly7ABAAAT+u0XTapfbV6k9sBAOB5ra+xfXW5fioAAPCsjrfgvlrswgMAAMAT2p3P6+0luq/DAwAAwJPaXaL7KdwBAACe1WWK6iHcBgAAntRlJXfNMgAA8Ow2q9VHuAkAADyrpWunAgDA81NxBwCA57TuzUbd63EHAICndFptugumXtaDdA0mAAB4Oocmqq9C0X23aG4vrjcBAICnsrus3b7afhyP1yunLsPDAADAUzlc6uzRwuWXAADgSb3H6L7sut0BAICnczif1+9mpQIAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAMBz2L8tVqvl  choir asks a tailor to sew customized outfits for all the members.</p>\\n\\n<p>The tailor needs 1.5 meters of cloth to sew a dress for each girl. For each boy, the tailor needs 1.58 times the cloth needed for a girl.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"8afaddcd-9702-498d-ad41-16f4006237dd\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>1) How much cloth is needed for one boy?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"6ec1fb04-78d0-42ff-9824-1b14061541cf\"},{\"params\":{\"inputFieldSize\":\"10\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2) How much cloth is needed for all the choir members?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"5e8e9c91-b666-47da-a6ce-30710a283633\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Problem\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem\"},\"subContentId\":\"fa9b9996-4ada-4b05-806f-efaeedab3547\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1) 1.5 × 1.58 = 2.37</p>\\n\\n<p>2.37 meters of cloth are needed for one boy.</p>\\n\\n<p> </p>\\n\\n<p>2) 1.5 × 11 = 16.5</p>\\n\\n<p>2.37 × 8 = 18.96</p>\\n\\n<p>16.5 + 18.96 = 35.46</p>\\n\\n<p>35.46 meters of cloth are needed for all the choir members.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"63a4f285-90c2-4405- LRRmoF09JmI3zxXrLqmoSQLi5sz/pgrCWF13fJcAVxcI/gEWzogc0Ul8gAQDmzix7ANpqPNYhAWimGDp4emcv3NzdN4YBmDuFf8DChRD+P8sFDgbbBl1HAAAAAElFTkSuQmCC\",\"mime\":\"image/png\",\"copyright\":{\"license\":\"U\"},\"width\":2084,\"height\":730},\"alt\":\"Sara and her family at the restaurant\",\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"b2b3a76f-ded6-4b0c-9585-8844bb5ae66a\"},{\"params\":{\"text\":\"<p>Every Friday, after Sara's tennis practice, the whole family goes out for dinner. Tonight, the Seif family decided to have a Lebanese dinner in an authentic restaurant.</p>\\n\\n<p>They ordered one plate of hommos for $3.75, 0.5 kilo of kababs for $38.5 a kilo, two plates of fries for $5 each, 3 cheese rolls for $1.75 a piece, 6 sambousik for $1.75 a piece, one plate of stuffed vine leaves for $3.75.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"9885ae8f-2ca3-4e4a-8585-d7774f9505da\"},{\"params\":{\"inputFieldSize\":\"10\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>1) How much does all the food cost?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"77890f60-2a1f-4e56-93cc-60abe2e846f7\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2) Seif's family would like to give a 10% tip to the waiters. To calculate the tip, multiply the cost of the food by 0.1. How much is the tip?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"db969c41-6d7d-4798-ad79-a41dae4204a3\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>3) How much money did Seif's family pay in total?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"9af3a462-5483-42a1-b8a0-02826779e61f\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Problem\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem\"},\"subContentId\":\"46c6a43e-1ccc-4239-9469-7fc62e8cbaa5\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1) Hommos: 1 × 3.75 = 3.75</p>\\n\\n<p>Kababs: 0.5 × 38.5 = 19.25</p>\\n\\n<p>Fries: 2 × 5 = 10</p>\\n\\n<p>Cheese rolls: 3 × 1.75 = 5.25</p>\\n\\n<p>Sambousik: 6 × 1.75 = 10.5</p>\\n\\n<p>Stuffed vine leaves: 1 × 3.75 = 3.75</p>\\n\\n<p>3.75 + 19.25 + 10 + 5.25 + 10.5 + 3.75 = 52.5</p>\\n\\n<p>The food costs $52.5.</p>\\n\\n<p> </p>\\n\\n<p>2) 52.5 × 0.1 = 5.25</p>\\n\\n<p>The tip is $5.25.</p>\\n\\n<p> </p>\\n\\n<p>3) 52.5 + 5.25 = 57.75</p>\\n\\n<p>Seif's family paid $57.75 in total.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"52d9208a-48d3-424f-b3d6-651d953dee5d\"},{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAC7gAAAOECAMAAAAGnIz6AAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAC3UExURf///8/Pz7+/v6enp0BAQHBwcJ+fn1BQUAAAAAgICOfn59/f33h4eCgoKGhoaLe3t1hYWBgYGBAQEPf395eXl+/v7yAgII+Pj9fX14eHh2BgYDg4ODAwMMfHx6+vr0hISH9/f+zs7Pj4+NLS0sHBwbKysrm5ucrKyuLi4vr6+uTk5MjIyPX19by8vNjY2L6+vv39/c3NzbS0tPDw8O7u7tra2tTU1N3d3enp6cPDw/Pz88bGxgAAAN6YhPgAAAA9dFJOU////////////////////////////////////////////////////////////
